const colors = [
  chalk.hex('#fbe8d3'),
  chalk.hex('#f4a261'),
  chalk.hex('#2a9d8f'),
  chalk.hex('#e76f51'),
  chalk.hex('#e63946'),
  chalk.hex('#6a4c93')
];
export async function animateGirl() {
  return new Promise((resolve) => {
    let index = 0;
    const interval = setInterval(() => {
      process.stdout.write('\x1b[H\x1b[J'); // Clear screen
      const frame = frames.shift();
      if (!frame) {
        clearInterval(interval);
        resolve();
        return;
      }
      const color = colors[index % colors.length];
      process.stdout.write(color(frame));
      index++;
    }, 50); // Puoi regolare la velocità qui
  });
}

